____&quot;^;logseq____&quot;,logseq____&quot;~u65030c41-021c-450d-9de7-57a8a2920042logseq____&quot;,536870919]],[logseq____&quot;^15logseq____&quot;,[305,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;近十年全球范围内烯烃行业最显著的变革之一是原料轻质化趋势，即烯烃生产原料逐渐由重质石脑油转向更为轻质的低碳烷烃乙烷、丙烷等。这一变化发生在 2007 年以后，美国的页岩气革命带来大量的天然气资源，同时伴生出大量价格低廉的乙烷和丙烷，可以作为清洁而低成本的烯烃原料。经过十年的发展，全球乙烯中轻质化原料占比已从2010 年的 32%提升到 2020 年的 40%，且除亚洲还有煤头和油头路线的增长，其他所有地区增量均来自于轻质化原料。\\nls-type:: annotation\\nhl-page:: 12\\nhl-color:: green\\nid:: 64cb2cf8-4826-46d9-b73b-9019add3cbc6logseq____&quot;,536870978]],[logseq____&quot;^15logseq____&quot;,[305,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870978]],[logseq____&quot;^15logseq____&quot;,[305,logseq____&quot;^Flogseq____&quot;,1609,536870978]],[logseq____&quot;^15logseq____&quot;,[305,logseq____&quot;^Xlogseq____&quot;,1608,536870978]],[logseq____&quot;^15logseq____&quot;,[305,logseq____&quot;^Vlogseq____&quot;,1608,536870978]],[logseq____&quot;^15logseq____&quot;,[305,logseq____&quot;^Ulogseq____&quot;,1608,536870978]],[logseq____&quot;^15logseq____&quot;,[305,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^1=logseq____&quot;,logseq____&quot;annotationlogseq____&quot;,logseq____&quot;^41logseq____&quot;,12,logseq____&quot;^42logseq____&quot;,logseq____&quot;greenlogseq____&quot;,logseq____&quot;^1@logseq____&quot;,logseq____&quot;64cb2cf8-4826-46d9-b73b-9019add3cbc6logseq____&quot;],536870978]],[logseq____&quot;^15logseq____&quot;,[305,logseq____&quot;^Jlogseq____&quot;,[logseq____&quot;^1=logseq____&quot;,logseq____&quot;^41logseq____&quot;,logseq____&quot;^42logseq____&quot;,logseq____&quot;^1@logseq____&quot;],536870978]],[logseq____&quot;^15logseq____&quot;,[305,logseq____&quot;^4logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^1=logseq____&quot;,logseq____&quot;annotationlogseq____&quot;,logseq____&quot;^41logseq____&quot;,logseq____&quot;12logseq____&quot;,logseq____&quot;^42logseq__  <script type="text/javascript">// Single Page Apps for GitHub Pages

      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
